import XCTest
@testable import MockUpUI

class MockUpUIExtensionTest: XCTestCase {
    // ideally going to put this in its own file and read from that file for testing this
    let imageBase64 = ""

    override func setUp() {
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }

    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
        super.tearDown()
    }
    
    func testUIViewExtension(){
        let view = UIView()
        view.roundCorners(.allCorners, radius: 12)
        XCTAssertNotNil(view)
        
        view.roundUpperCorners(radius: 12)
        XCTAssertNotNil(view)
        
        view.animateButtonPress()
        XCTAssertNotNil(view)
    }
    
    func testUIImageExtension(){
        let data = UIImage().base64Decode(strBase64: imageBase64)
        XCTAssertNotNil(data)
        let imageData =  data?.pngData()
        if let imgData = imageData{
          XCTAssertTrue(imgData.count > 0)
        }else{
            XCTFail("Image data was nil")
        }
    }
    
    func testDateExtension(){
        let date = "2019-09-06 15:30:34"
        let convertedDate = Date().convertServerDateTime(dateString: date)
        XCTAssertEqual(convertedDate, "06/09/2019 15:30")
        
        let garbageDate = "sdlfhsdofj"
        let convertedGarbageDate = Date().convertServerDateTime(dateString: garbageDate)
        XCTAssertEqual(convertedGarbageDate, "")
    }
}
